Snakemake
{
"application": "Snakemake",
"details": {
"resource_requirements": {
"time": "48 hours",
"cpus": 60,
"memory": "240GB",
"gpu": 1,
"partition": "gpu",
"account": "general"
},
"software_requirements": {
"python": "any",
"snakemake": "any"
},
"workflow_description": "The script runs a Snakemake workflow for generating node embeddings using various methods (Fairwalk, Crosswalk, node2vec, RandomWalk, Residual2Vec, GCN, GAT) and baselines. The workflow is executed for five different configurations (root=airport_one to airport_five) and for each configuration, it runs a set of experiments with different node embedding methods. The script also includes options for degree-agnostic embeddings."
}
}
